package com.proxy.whatsapp.core.clients.wppconnect;

import java.util.List;

import org.springframework.boot.autoconfigure.condition.ConditionalOnProperty;
import org.springframework.stereotype.Service;

import com.proxy.whatsapp.core.clients.wppconnect.dto.ResponseSendMessage;
import com.proxy.whatsapp.core.clients.wppconnect.dto.ResponseSendMessage.Response;
import com.proxy.whatsapp.core.clients.wppconnect.dto.ResponseStarSession;
import com.proxy.whatsapp.core.clients.wppconnect.dto.ResponseStatusSession;
import com.proxy.whatsapp.exceptions.WhatsAppException;

import lombok.extern.slf4j.Slf4j;

@Slf4j
@ConditionalOnProperty(name = "whatsapp.wppconnect.enabled", havingValue = "false", matchIfMissing = false)
@Service("wpp")
public class WppconnectClientMockImpl implements WppconnectClient {

	private int tentativa = 0;

	public WppconnectClientMockImpl() {
		log.info("[Wppconnect]: Starting mock service");
	}

	public ResponseSendMessage sendMessage(String toPhoneNumber, String message) {

		log.info("Requisição: {}.", tentativa);

		if (tentativa < 3)
			tentativa++;

		if (tentativa <= 2)
			throw new WhatsAppException("Erro ao enviar mensagem mockada.", null);

		return ResponseSendMessage.builder().status("success").session("mocked")
				.response(List.of(Response.builder().from(toPhoneNumber).to(toPhoneNumber).body(message).build()))
				.build();
	}

	public ResponseStarSession startSession() {
		return ResponseStarSession.builder().status("QRCODE")
				.qrcode("""
						data:image/png;base64,
						""")
				.urlcode(
						"2@p2Vgf88GU7KNtb3odKlM+iX2VYQ102Dixk7wr230fenrKzGT+I+5A1lCslG48gpw8LqfVDpRDfKV3MGOEVTTh2E/TwBWYfezu88=,R+ew1HobdPCsCBkOCKVi5ZoD2eXtdAw4rmWQdy3nLRE=,ore7qv5IWAtRUYOsWqFjEdrnLxkNUhFJ+Y6nugK8ckA=,DNWqKpHJhkPDN7QeXQtWnsed6M6LxRwkVBrQrl10tdA=,0")
				.session("test-app-springboot-java").build();
	}

	public ResponseStatusSession statusSession() {
		return ResponseStatusSession.builder().status("QRCODE")
				.qrcode("""
						data:image/png;base64,
						""")
				.build();
	}

	public ResponseStatusSession logoutSession() {
		return null;
	}

	public ResponseStatusSession closeSession() {
		return null;
	}

}
